import React, { useState,useEffect } from 'react'
import axios from 'axios';


const TEST = () => {

const [data,setData] = useState([])


  useEffect(() => {
    let isApicancel = true

    axios.get('http://localhost/REACTJS/cognate1%20api/ProductdataAPI.php')
    .then(res=>{
      
      if (isApicancel)
      {
        setData(res.data)

      }
    
      
     })

    //  pangcancel ng reqest pag di naka open
     return () => isApicancel = false
  })
 const image = data.filter(e=>e.Product_ID === 2379).map(e=>e.Product_image)
  return (
    <div>

      {data.map(e=>{
       <img

       src= {e.Product_image}
       alt='asd'
        // loading="lazy"
    /> 
      })
      
      }

    





    </div>
  )
}

export default TEST
